import { RouteMain as Routes } from "./Routes";
import { Global } from "./styles/global";
import { Providers } from "./Contexts/UserContext";
import { ProvidersTech } from "./Contexts/TechContext";
import { ToastContainer } from "react-toastify";
function App() {
  return (
    <>
      <Global />
      <Providers>
        <ProvidersTech>
          <Routes />
        </ProvidersTech>
      </Providers>
      <ToastContainer
        position="top-right"
        autoClose={1200}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="dark"
      />
    </>
  );
}

export default App;
